// ==UserScript==
// @name        Pardus Max AP Alert
// @namespace   beigeman
// @description Provides an optional audible alert when APs are full.
// @include     http*://*.pardus.at/main.php*
// @grant	    none
// @require     http://www.grandunifyingalliance.com/gm/pal.js
// @version     1
// ==/UserScript==

// CUSTOMISATION
var alertDuration = 10;
var timeBetweenAlerts = 10;
var soundFile = "data:audio/ogg;base64,";
var volume = 100; // 100 is full volume, 0 is mute.
var maxKnown = gmGetValue("maxKnownAPCount", 5000);
var maxAP = maxKnown;

// DO NOT EDIT.
var audioTag = null;
var stopTimeout = null;
var betweenAlertTimeout = null;
var timerActive = false;

// We're in the msgframe.
// Some sanity checking.
sanityCheckVolume();
sanityCheckTimeouts();

// Make timeouts into miliseconds.
alertDuration *= 1000;
timeBetweenAlerts *= 1000;

// Make volume in range of 0-1
volume /= 100;

var apImg = document.querySelector('#tdStatusApsImg').childNodes[0];

if(apImg)
{
    apImg.addEventListener("click", imageClick, true);
}

function imageClick()
{
    var newImg = document.createElement('img'); 
    apImg = document.querySelector('#tdStatusApsImg').childNodes[0];
    
    if(timerActive == false)
    {
        var apTag = document.querySelector('#tdStatusAps'); 
                
        if (apTag)
        {
            var ap = parseInt(apTag.childNodes[0].textContent, 10)
            
            if (ap)
            {
                if ( ap > maxKnown ) gmSetValue("maxKnownAPCount", ap);
                
                var mins = ((maxAP - ap) / 24) * 6;
                var miliseconds = (mins * 60) * 1000;
            
                newImg.src = "data:image/png;base64,";
                newImg.title = "Waiting " + mins + " minutes to play Max AP alert";
                                
                initAudio(soundFile, miliseconds);
                timerActive = true;
            }       
        }
    }
    else
    {
        newImg.src = "data:image/png;base64,";        
        cancelAlert();
        timerActive = false;
    }
    
    newImg.addEventListener("click", imageClick, true);

    apImg.parentNode.appendChild(newImg);
    apImg.parentNode.removeChild(apImg);
}


/*
 * Audio Functions
 */ 
function initAudio(sound, delay)
{
    if (sound != "")
    {
        if (!document.getElementById('apMaxAlertAudio'))
        {
            audioTag = document.createElement('audio');
            audioTag.id = "apMaxAlertAudio";
            audioTag.setAttribute('src', sound);
		    audioTag.setAttribute('loop', 'loop');
            audioTag.load();
            document.body.appendChild(audioTag);
            audioTag.volume = volume;                
        }
        
        stopTimeout = setTimeout(repeatAlert, delay);
    }
}

// Stops the beep from occurring. Happens after alertDuration seconds.
function stopAlert()
{
    try 
    {
        audioTag.currentTime=0;
        audioTag.pause();
    }
    catch (err) 
    {
        // Ignore
    }
}

function playAlert()
{
    audioTag.play();
    stopTimeout = setTimeout(stopAlert, alertDuration);
}

function repeatAlert() 
{
    stopAlert();
    playAlert();
    betweenAlertTimeout = setTimeout(repeatAlert, timeBetweenAlerts);
}

function cancelAlert()
{
    stopAlert();
    
    try
    {
        clearTimeout(betweenAlertTimeout);
    }
    catch (err) { console.log("Error cleaing timeout 1"); }
    try
    {
        clearTimeout(stopTimeout);
    }
    catch (err) { console.log("Error cleaning timeout 2"); }
}

function sanityCheckVolume() 
{
    if (volume > 100)
    {
        volume = 100;
    }
    else if (volume < 0)
    {
        volume = 0;
    }
}

function sanityCheckTimeouts() 
{
    if (alertDuration > timeBetweenAlerts)
    {
        timeBetweenAlerts = alertDuration;
    }
}

/*
 * GM Functions
 */
 /* Reimplementations of GM functions using local storage. */
function gmSetValue(name, value)
{
    if (typeof(Storage) !== "undefined")
    {
        value = (typeof value)[0] + value;
        localStorage.setItem(name, value);
    }
}

function gmGetValue(name, defaultValue)
{
    if (typeof(Storage) !== "undefined")
    {
        if (name)
        {
            var value = localStorage.getItem(name);

            if ((!value) && defaultValue) return defaultValue;
            if (!value) return null;

            var type = value[0];
            value = value.substring(1);
            switch (type) {
                case 'b':
                    return value == 'true';
                case 'n':
                    return Number(value);
                default:
                    return value;
            }
        }
    }
}

